function drawChart(){var a=google.visualization.arrayToDataTable([["Task","Hours per Day"],["Work",11],["Eat",2],["Commute",2],["Watch TV",2],["Sleep",7]]);new google.visualization.PieChart(document.getElementById("topLeft")).draw(a,{title:"My Daily Activities"})}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(drawChart);